        public init(bookmarked: Bool? = nil, embeddingDisabled: Bool? = nil, like: String? = nil, pinned: Bool? = nil, replyDisabled: Bool? = nil, repost: String? = nil, threadMuted: Bool? = nil) {
            self.bookmarked = bookmarked
            self.embeddingDisabled = embeddingDisabled
            self.like = like
            self.pinned = pinned
            self.replyDisabled = replyDisabled
            self.repost = repost
            self.threadMuted = threadMuted
            self._unknownValues = [:]
        }

        enum CodingKeys: String, CodingKey {
            case bookmarked
            case embeddingDisabled
            case like
            case pinned
            case replyDisabled
            case repost
            case threadMuted
        }

        public init(from decoder: any Decoder) throws {
            let keyedContainer = try decoder.container(keyedBy: CodingKeys.self)
            self.bookmarked = try keyedContainer.decodeIfPresent(Bool.self, forKey: .bookmarked)
            self.embeddingDisabled = try keyedContainer.decodeIfPresent(Bool.self, forKey: .embeddingDisabled)
            self.like = try keyedContainer.decodeIfPresent(String.self, forKey: .like)
            self.pinned = try keyedContainer.decodeIfPresent(Bool.self, forKey: .pinned)
            self.replyDisabled = try keyedContainer.decodeIfPresent(Bool.self, forKey: .replyDisabled)
            self.repost = try keyedContainer.decodeIfPresent(String.self, forKey: .repost)
            self.threadMuted = try keyedContainer.decodeIfPresent(Bool.self, forKey: .threadMuted)
            let unknownContainer = try decoder.container(keyedBy: AnyCodingKeys.self)
            var _unknownValues = [String: AnyCodable]()
            for key in unknownContainer.allKeys {
                guard CodingKeys(rawValue: key.stringValue) == nil else {
                    continue
                }
                _unknownValues[key.stringValue] = try unknownContainer.decode(AnyCodable.self, forKey: key)
            }
            self._unknownValues = _unknownValues
        }

        public func encode(to encoder: any Encoder) throws {
            var container = encoder.container(keyedBy: CodingKeys.self)
            try container.encodeIfPresent(self.bookmarked, forKey: .bookmarked)
            try container.encodeIfPresent(self.embeddingDisabled, forKey: .embeddingDisabled)
            try container.encodeIfPresent(self.like, forKey: .like)
            try container.encodeIfPresent(self.pinned, forKey: .pinned)
            try container.encodeIfPresent(self.replyDisabled, forKey: .replyDisabled)
            try container.encodeIfPresent(self.repost, forKey: .repost)
            try container.encodeIfPresent(self.threadMuted, forKey: .threadMuted)
            try _unknownValues.encode(to: encoder)
        }
    }
}
